import classessGreg from './Dialogs.module.css'

const DialogItem = (props)=> {
    const link = props.link + props.id
    return <li><NavLink to={link}> {props.name} </NavLink></li>
}

const Message = (props)=> {
    return <div>
        {props.message}
    </div>
}

const MessagesData = [
    {
        id: 1,
        name: 'Valera'
    },
    {
        id: 2,
        name: 'Mark'
    },
    {
        id: 3,
        name: 'Elena'
    }
]

const Dialogs = (props)=> {
    return <div className={classessGreg.dialogs}>
        <ul>
        {MessagesData.map(data => console.log(data))}
        {/* <DialogItem link='/dialogs/' id='1' name='Valera' /> */}
        </ul>
        <div>
            <Message message='Hy My name is Petr'/>
            <Message message='I dont belive you '/>
        </div>
    </div>
}

export default Dialogs
